import styled from "styled-components";

export const OpacScreen = styled.div`
  position: absolute;
  height: 100vh;
  width: 100%;
  left: 0px;
  bottom: 0px;
  top: 82.5px;
  background: rgba(0, 0, 0, 0.5);
  transition: all 0.7s;
  opacity: 0;
  z-index: -2;
`;
